', 'Setelah dilakukan tindakan keperawatan 2x 24 jam Tingkat nyeri menurun dengan  kriteria hasil : keluhan nyeri menurun,   Setelah dilakukan tindakan keperawatan selama 3x24 jam Toleransi Aktivitas Meningkat dengan kriteria hasil :Tekanan darah membaik, frekuensi nadi meningkat, keluhan lelah menurun, setelah dilakukan tindakan keperawatan selama 2x24 jam diharapkan Tingkat Infeksi menurun dengan Kriteria Hasil :Kebersihan tangan meningkat,Kebersihan badan meningkat,Nafsu makan meningkat,Demam menurun,Nyeri menurun,Kemerahan menurun,Bengkak menurun,Area luka membaik,Kadar sel darah putih membaik,Kultur darah,urine sputum,area luka dan feses membaik .', '', '', '', '', '', '', '', '', '1645', '1', 'Intervensi mandiri :<div>- Identifikasi lokasi, karakteristik, durasi, frekuensi, kualitas, intensitas nyeri, Identifikasi skala nyeri, Identifikasi respons nyeri non verbal, Monitor adanya kelelahan otot bantu nafas. Monitor status respirasi dan oksigenisasi. Pertahankan kepatenan jalan nafas. Berikan posisi semi fowler atau fowler. Analisis efek perubahan posisi pada pernafasan (mis.AGD,SaO2).- Identifikasi penyebab gangguan integritas kulit (mis. Perubahan sirkulasi, perubahan status nutrisi, peneurunan kelembaban, suhu lingkungan ekstrem, penurunan mobilitas),,monitor tanda dan gejalan perdarahan,monitor nilai hb, sebelum dan setelah kehilangan darah ,monitor ttv ortostatis,Sediakan lingkungan nyaman dan rendah stimulus (misal, cahaya, suara, kunjungan)</div><div>Intervensi Kolaborasi:</div><div>- Awasi TNSP + perdarahan</div><div>-- Jaga OH sikat gigi + kumur minosep</div><div>- Latihan buka mulut lebar</div><div>-cek DR jam 14 === TUnggu hasil</div>', NULL, '1645', 0, NULL, '2025-06-27 12:52:16')
